import { useState, useEffect } from "react";
import UserIcon from "@heroicons/react/outline/UserIcon";

function Register() {
  const [formData, setFormData] = useState({
    firstName: "",
    lastName: "",
    email: "",
    password: "",
  });
  const { email, password, firstName, lastName } = formData;

  //   useEffect(() => {});
  const onChange = () => {};
  return (
    <>
      <section className="bg-red-500 flex flex-col items-center text-white mb-2 rounded-b-lg">
        <div className="h-10 w-10">
          <UserIcon />
        </div>
        <h1 className=" font-bold">Register</h1>
      </section>
      <section className="flex">
        <form action="POST">
          <div className="">
            <input
              type="text"
              id="firstName"
              name="name"
              value={firstName}
              placeholder="First name..."
              onChange={onChange}
              className="border-2 rounded-lg p-2 mb-2 bg-secondary"
            />
          </div>
          <div className="">
            <input
              type="text"
              id="lastName"
              name="name"
              value={lastName}
              placeholder="Last name..."
              onChange={onChange}
              className="border-2 rounded-lg p-2 mb-2 bg-secondary"
            />
          </div>
          <div className="">
            <input
              type="email"
              id="email"
              name="email"
              value={email}
              placeholder="Email..."
              onChange={onChange}
              className="border-2 rounded-lg p-2 mb-2 bg-secondary"
            />
          </div>
          <div className="">
            <input
              type="text"
              id="name"
              name="name"
              value={password}
              placeholder="Password..."
              onChange={onChange}
              className="border-2 rounded-lg p-2 mb-2 bg-secondary"
            />
          </div>
          <button type="submit" className="bg-third text-black">
            Create Account
          </button>
        </form>
      </section>
    </>
  );
}

export default Register;
